tables.table_schema:
CREATE TABLE Robots (
    robot_id SERIAL PRIMARY KEY,
    robot_name VARCHAR(50) NOT NULL,
    blueprint TEXT NOT NULL,
    version INT NOT NULL
);

CREATE TABLE RobotDesigns (
    design_id SERIAL PRIMARY KEY,
    robot_id INT REFERENCES Robots(robot_id),
    design_specifications TEXT NOT NULL,
    created_date TIMESTAMP
);

CREATE TABLE robots (
  robot_id INT PRIMARY KEY,
  robot_name VARCHAR(255) NOT NULL,
  blueprint TEXT NOT NULL,
  date_created TIMESTAMP
);

CREATE TABLE robot_parts (
  part_id INT PRIMARY KEY,
  part_name VARCHAR(255) NOT NULL,
  robot_id INT,
  FOREIGN KEY(robot_id) REFERENCES robots(robot_id)
);

CREATE TABLE designers (
  designer_id INT PRIMARY KEY,
  designer_name VARCHAR(255) NOT NULL,
  robot_id INT,
  FOREIGN KEY(robot_id) REFERENCES robots(robot_id)
);

CREATE TABLE Robots (
  id INT PRIMARY KEY,
  name VARCHAR(255) NOT NULL,
  design TEXT,
  version INT
);

CREATE TABLE Users (
  id INT PRIMARY KEY,
  username VARCHAR(255) NOT NULL,
  email VARCHAR(255) NOT NULL,
  role VARCHAR(50)
);
